import React from 'react';

const Work = () => {
    return (
        <div className='work-page'>
            <h2 className='heading'>Work Experience</h2>
            <p>This is a little website I built for myself.</p>
            <p>I was tired of conventional PDF resumes.</p>
            <p>So 20th century.</p>
            <p>You can find all of my information here.</p>
            <p>Enjoy.</p>
        </div>
    )
}

export default Work;
